import React from 'react'
import { EntityConfig } from '../config/main/schema'
import { useQuery } from 'react-query';

export default function Table({ entityConfig }: any) {
  const { data, status } = useQuery("fetchData", entityConfig.fetch)

  const fields = entityConfig.fields
  //     Object.keys(fields).map(fieldString=>console.log(fields[fieldString]))


  //  Object.keys(fields).map(fieldString => <th>{fields[fieldString].label}</th>)


  // data.forEach((element)=>{
  //  Object.keys(fields).map(fieldString=>console.log(element[fieldString]))}


  //@ts-ignore
  data.forEach((e) => console.log(e))


  if (status === 'loading') return <h1>Loading...</h1>
  if (status === 'error') return <h1>There has been an error</h1>
  return (
    <table>
      <tr>
        {Object.keys(fields).map(fieldString => <th>{fields[fieldString].label}</th>)}
      </tr>
      <tr>

        {//@ts-ignore
          data.map(e => <td>{e.id}</td>
          )}
        <td>gbyhy</td>
      </tr>
    </table>
  )
}
